import './App.css';
import React from 'react';

function LostPerson() {
  return (
    <div className="LostPerson">
      <header className="App-header">
        <form>
          <h3> Persona Extraviada</h3>
          <label>
            Perona Extraviada
            <input type="text" name="Nombre" />
          </label>

          <input type="submit" value="Submit" />
        </form>
      </header>
    </div>
  );
}


export default LostPerson;
